import React from 'react';
import styled from 'styled-components';
import HeroSection from '../components/HeroSection';

const HomeContainer = styled.div`
  text-align: center;
`;

const IntroText = styled.p`
  font-size: 1.1rem;
  margin: 1rem 0;
  color: #333;
`;

function Home({ selectedRoute }) {
  return (
    <div>
      <HeroSection />
      <HomeContainer>
        <IntroText>
          Track your campus buses in real-time. Built for SUNY Oswego students.
        </IntroText>
      </HomeContainer>
    </div>
  );
}

export default Home;
